
const fs = require('fs');
const buffer = require('buffer');


const {dataBlockDefine, blockType, headerDefine} = require('./pngDefination.js');

var bufferData = fs.readFileSync('../1.png');

var len = bufferData.length;

readPng(bufferData);

function readPng(bufferData){
	let pngInfo = [];
	let offset = 0;
	console.log('length', len);
	// 头部
	let header = {};
	header.block = bufferData.slice(offset, offset + headerDefine.hex.length);
	header.hexBlock = header.block.toString('hex');
	header.chunkTypeCode = 'fileHeader';
	offset += headerDefine.hex.length;
	pngInfo.push(header);
	while(offset < len){
		// length: 4,
		// chunkTypeCode: 4,
		// chunkData: Infinity,
		// crc: 4
		let blockDefine = {};

		let blockLengthBuffer = bufferData.slice(offset, offset + dataBlockDefine.length);

		// 转换成10进制，是对buffer数组进行转换，而不是单个byte
		blockDefine.length = +('0x'+blockLengthBuffer.toString('hex'));

		offset += dataBlockDefine.length;

		let chunkTypeCodeBuffer = bufferData.slice(offset, offset + dataBlockDefine.chunkTypeCode);
		
		blockDefine.chunkTypeCode = chunkTypeCodeBuffer.toString('ascii');


		offset += dataBlockDefine.chunkTypeCode;

		if(blockDefine.chunkTypeCode === 'IHDR'){
			var subOffset = offset;
			blockDefine.width = +('0x'+bufferData.slice(subOffset, subOffset + 4).toString('hex')) + 'px';
			subOffset += 4;
			blockDefine.height = +('0x'+bufferData.slice(subOffset, subOffset + 4).toString('hex')) + 'px';
			subOffset += 4;
			blockDefine.bitDepth = +('0x'+bufferData.slice(subOffset, subOffset + 1).toString('hex'));
			subOffset += 1;
			blockDefine.colorType = +('0x'+bufferData.slice(subOffset, subOffset + 1).toString('hex'));
			subOffset += 1;
			blockDefine.compressionMethod  = +('0x'+bufferData.slice(subOffset, subOffset + 1).toString('hex'));
			subOffset += 1;
			blockDefine.filterMethod = +('0x'+bufferData.slice(subOffset, subOffset + 1).toString('hex'));
			subOffset += 1;
			blockDefine.interlaceMethod = +('0x'+bufferData.slice(subOffset, subOffset + 1).toString('hex'));
		}else if(blockDefine.chunkTypeCode === 'PLTE'){
			var subOffset = offset;
			blockDefine.red = +('0x'+bufferData.slice(subOffset, subOffset + 1).toString('hex'));
			subOffset += 1;
			blockDefine.green = +('0x'+bufferData.slice(subOffset, subOffset + 1).toString('hex'));
			subOffset += 1;
			blockDefine.blue = +('0x'+bufferData.slice(subOffset, subOffset + 1).toString('hex'));
			subOffset += 1;
		}
		let chunkDataBuffer = bufferData.slice(offset, offset + blockDefine.length);
		blockDefine.chunkData = chunkDataBuffer;
		blockDefine.chunkDataLength = chunkDataBuffer.length;
		offset += blockDefine.length;

		blockDefine.crc = bufferData.slice(offset, offset + dataBlockDefine.crc).toString('hex');
		offset += dataBlockDefine.crc;
		console.log(blockDefine);
		console.log(offset, 'offset');
		pngInfo.push(blockDefine);
	}

	fs.writeFile('pngFile.json', JSON.stringify(pngInfo));
	
}

